    public int bestRotation(int[] A) {
        if (A == null) {
            return 0;
        }
        if (A.length == 1) {
            return 0;
        }
        int k = doRotation(A, 0, new TreeMap<Integer, List<Integer>>());
        return k;
    }

    int doRotation(int[] A, int k, TreeMap<Integer, List<Integer>> scoreToKsMap) {
        if (k == A.length-1) {
            int maxScore = scoreToKsMap.lastKey();
            List<Integer> KsForScopre = scoreToKsMap.get(maxScore);
            Collections.sort(KsForScopre);
            return KsForScopre.get(0);
        }

        int score = 0;
        for (int i=0; i<A.length; i++) {
            if (A[i] <= i) {
                score++;
            }
        }

        List<Integer> KsForScopre = scoreToKsMap.get(score);
        if (KsForScopre == null) {
            KsForScopre = new ArrayList<>();
        }
        KsForScopre.add(k);
        scoreToKsMap.remove(score);
        scoreToKsMap.put(score, KsForScopre);

        int zero = A[0];
        for (int i=1; i<A.length; i++) {
            A[i-1] = A[i];
        }
        A[A.length-1] = zero;

        return doRotation(A, k+1, scoreToKsMap);
    }

